@PriyankaChopra Jonas takes on Vogue’s Impossible Questions

“The last time I wore my underwear over my pants I felt like a hero,” reveals #PriyankaChopra Jonas while answering Vogue's Impossible Questions. Watch as the actor, singer and philanthropist explains why exactly she’d like to roll around on Mars, debates riding an elephant or a giraffe to go to work, and sings the theme tune to her life.

Styled by @NathanKleinStyling, hair by @SamMcKnight1, make-up by @WendyRowe, set design by Lee Flude and casting by @NurrrrCasting.

